There are three loading functions: load_one , load_many and load_page . All loading functions take a Toql query and will translate it into SQL SELECT statement(s). The resulting rows will be deserialized and returned. If your Toql structs contain a Vec of other structs, the load functions issue multiple SELECT statements and merge the results. If you expect exactly one result, use load_one . use toql::prelude::{query, ToqlApi, Cache, Toql, ToqlError}; use toql::mock_db::MockDb; #[derive(Toql)] struct User { #[toql(key)] id: u64, title: Option<String> } # #[tokio::main(flavor="current_thread")]
