# } The function will return ToqlError::NotFound if no row matched the query filter or ToqlError::NotUnique if more than one row matched. To load zero or one row use load_page , see below. Similarly, if you need to load multiple rows use load_many , that returns a Vec with deserialized rows. The Vec will be empty, if no row matched the filter criteria. load_page allows you to select a page with a starting point and a certain length. It returns a Vec and count information. The count information is either None for an uncounted page or contains count statistics that is needed for typical pagers in web apps, see below. (After all Toql was initially created to serve web pages.) To load the first 10 -or less- rows do this: use toql::prelude::{query, ToqlApi, Cache, Toql, Page}; use toql::mock_db::MockDb; #[derive(Toql)] struct User { #[toql(key)] id: u64, title: Option<String> } # #[tokio::main(flavor="current_thread")]
