# } To serve a webpage, you may also want to include count informations, call the above with let (u, c) = toql.load_page(q, Page::Counted(0, 10)).await.unwrap(); The code is almost the same, but the different page argument will issue two more select statements to return the filtered page length and the total page length. Let's see what those are: Suppose you have a table with books. The books have an id, a title and an author_id. id title author_id 1 The world of foo 1 2 The world of bar 1 3 The world of baz 1 4 What 42 tells me 1 5 Flowers And Trees 2 Let's assume we have a webpage that contains a pager with page size 2 and a pager filter. The author wants to see all books that contain the word world . What will he get? The first two rows (id 1, id 2). The filtered page count of 3, because 3 rows match the filter criteria. The pager can now calculate the number of pages: ceil(3 / 2) = 2 The total page count of 4. The author knows now that with a different filter query, he could get at most 4 rows back. In practice the total page count is not so straight forward to select: Toql needs to decide, which filters from the query to consider or ignore when building the count SQL statement. For the total page count only filters are used on fields that are listed in the special count selection and predicates that are marked as count filters.

