// We also want a custom filter function SC // so that we can filter for a specific permission.
//
// This allows the following toql queries
// Todos with any permissions -> `*, permission ne ''` // Todos with UPDATE permission -> `*, permission fn sc 'UPDATE'` struct PermissionFieldHandler{ default_handler: DefaultFieldHandler, // The default field handler gives us default filters, such as `ne`
}; impl FieldHandler for PermissionFieldHandler
{ fn build_select( &self, sql: SqlExpr, aux_params: &ParameterMap, ) -> Result<Option<SqlExpr>, SqlBuilderError> { // Get user_id from aux params (typically from web auth token) let user_id = aux_params.get("user_id").unwrap_or(&SqlArg::Null); // Get entity from aux params (locally provided with permission handler) let entity = aux_params.get("entity").unwrap_or(&SqlArg::Null).to_string(); // Build subselect // Notice our special .. alias, it will be resolved later by the query builder // Build a string list with all permissions that we have as owners let sql = sql_expr!("(SELECT GROUP_CONCAT( p.action) FROM Permission p \ WHERE p.entity = ? AND \ (p.owner_only = false OR ..owner_id = ?))", entity, user_id); Ok(Some(sql)) } fn build_filter( &self, select: SqlExpr, filter: &FieldFilter, aux_params: &ParameterMap, ) -> Result<Option<SqlExpr>, SqlBuilderError> { match filter { // Support our custom SC filter that maps to the MySQL FIND_IN_FIELD function FieldFilter::Fn(name, args) => match name.as_str() { "SC" => { filter_sc(name, select, args) }, name @ _ => Err(SqlBuilderError::FilterInvalid(name.to_string())), }, _ => self.default_handler.build_filter(select, filter, aux_params), } }
} pub fn filter_sc( name: &str, select: SqlExpr, args: &[SqlArg]
) -> Result<Option<SqlExpr>, SqlBuilderError> { if args.len() != 1 { return Err(SqlBuilderError::FilterInvalid( format!("filter `{}` expects exactly 1 argument",name))); } Ok(Some(sql_expr!("FIND_IN_SET (? , {})", &args[0], select))) } // Getter fucntion for the mapper
